    "1903年，伍连德以有关破伤风菌的学术论文，被授予剑桥大学医学博士学位。\n\n此后到新成立的吉隆坡医学研究院从事了一年的疟疾和脚气病的研究工作。",
    "1904年底，他回到槟榔屿，在珠烈街开设私人诊所。",
