   // "1914年4月，伍连德在上海与颜福庆、俞凤宾等7人组建中华医学会，\n\n伍连德被选为会长，同时出版了《中华医学杂志》。",
    "1918年，伍连德任北洋政府中央防疫处处长、北京中央医院（今北京医科大学人民医院分院）院长",
